import React from 'react';
import { BrowserRouter as Router, Route} from 'react-router-dom';
import EmailForm from '../components/EmailForm/EmailForm';
import IELTSAcademic from './IELTSAcademic';
import IELTSGeneral from './IELTSGeneral';
import TOELF from './TOELF';
import ChooseTest from './ChooseTest';
import axios from 'axios';
const { auth } = require("google-auth-library");
const {google} =  require("googleapis");

const Home = () =>{

    const auth = new google.auth.GoogleAuth({
        keyFile: "credentials.json",
        scopes: "https://www.googleapis.com/auth/spreadsheets",

    });

    const client = auth.getClient();

    const googleSheets = google.sheets({version:"v4", auth:client});

    const spreadsheetId = "1NuwtImqfSSXduf_52o6_Z9JkOaicplfLdHl9l3Aj6OM";

    const metaData = googleSheets.spreadsheets.get({
        auth,
        spreadsheetId,

    });
    
//await res.send(getRows.data);

    return (
        <>
        <h1>This is an H1</h1>
        <Router>
            <Route exact path="/Home/IELTSAcademicA"><IELTSAcademic version="A"/></Route>
            <Route exact path="/IELTSAcademicB"><IELTSAcademic version="B"/></Route>
            <Route exact path="/IELTSGeneralA"><IELTSGeneral version="A"/></Route>
            <Route exact path="/IELTSGeneralB"><IELTSGeneral version="B"/></Route>
            <Route exact path="/TOELFA"><TOELF version="A"/></Route>
            <Route exact path="/TOELFB"><TOELF version="B"/></Route>
            <Route exact path="/Home/ChooseTest"><ChooseTest/></Route>
            <Route exact path="/bloom"><EmailForm name="this is button" path="/Home/ChooseTest"/></Route>
        </Router>
        </>
        
    )
}

export default Home;
